import Data from './Data'

const SuggestionBox = ({text}) => {
    const renderSuggestions = () => {
        const filteredData = Data.filter((a) => {
            console.log(a, text)
            if(a.includes(text)){
                return true
            }
        })

        console.log(filteredData)
    }


    return (
        <>
            {renderSuggestions()}
        </>
    )
}

export default SuggestionBox
